import { Link } from "react-router-dom"
import {handleHomeClick} from "./Handle/handleHomeClick"

const Nav = () => {
    return(
        <div>
            <Link to={"/home"} onClick={handleHomeClick()}>
                <p>
                    HOME
                </p>
            </Link>
            <Link to={"/form"}>
                <p>
                    ADD ACTIVITY
                </p>
            </Link>
        </div>
    )
};

export default Nav;
